import React from 'react';

const RecipeIdea = () => {
  return (
    <div>
      <h2>Recipe Ideas</h2>
      <p>यहाँ आप नए रेसिपी आइडिया देख सकते हैं।</p>
    </div>
  );
};

export default RecipeIdea;
